import { HeaderImage, StyledNavbar, StyledContainer ,RightContainer, Add, EnButton,Links} from "./styles";
import logo from "./image1.svg";
import { FaSearch } from "react-icons/fa";

export const Navbar = (probs) => {
  return (
    <StyledNavbar>
      <StyledContainer>
        <HeaderImage image={logo}>   
            <img src={logo} alt="image" />
               </HeaderImage>
               <ul>
                 <li>Movies</li>
                 <li>About</li>
                 <li>Offers</li>
                 <li>Offers</li>
               </ul>
      </StyledContainer>
      <RightContainer>

                 <Add />
          <EnButton>EN</EnButton>
          <Links>Login</Links>
          <Links>Join TMDB</Links>

                <FaSearch size={20} color={'#0291BC'}></FaSearch>


         </RightContainer>
    </StyledNavbar>
  );
};
